import React from "react";
import PropTypes from "prop-types";

const Blog = ({ post }) => {
    return (
        <li>
            <h3>
                <b>{post.title}</b>
            </h3>
            <br />
            {post.body}
        </li>
    );
};

Blog.propTypes = {
    post: PropTypes.object
}

export default Blog;
